import React from "react";
import "../css/mainBlock.css";
function Header() {
  return (
    <header>
      <div className="container"></div>
    </header>
  );
}

function MainBlock() {
  return (
    <section className="main-block">
      <h1>Hello</h1>
      <Header />
    </section>
  );
}
export default MainBlock;
